Happy 7th Birthday (May 23rd) to the apple of our eyes - the sweetest, kindest, and the most wonderful daughter in the world! Watching you grow has been the greatest joy of our lives. You light up every room with your smile and fill our hearts with love and pride. We’re so lucky to have you, our little princess. Keep dreaming big and never stop being your amazing self. We love you more than words can say! 

Looking back at 7 amazing moments from the year gone by to celebrate her 7th ❤️❤️

